function Message({ key, content }) {
  console.log(key);
  return (
    <div className="flex justify-end">
      <div className="w-fit bg-[#EFF6FF] mx-10 px-5 py-5 rounded-lg">
        <p className="text-wrap">{content}</p>
      </div>
    </div>
  );
}

export default Message;
